(5, 3, 'struktur-organisasi', 'STRUKTUR ORGANISASI', NULL, NULL, NULL, '<p><img alt=\"\" src=\"https://disporapar.kalbarprov.go.id/public/assets/images/upload/struktur%20organisasi%20terbaru%20(2).jpeg\" /></p>', NULL, NULL, NULL, NULL, NULL, 2, '2022-06-29 22:29:52', '2022-06-29 22:29:52', 0),
(6, 4, 'profil-dinas', 'PROFIL DINAS', NULL, NULL, NULL, '<p>Dinas Kepemudaan, Olahraga dan Pariwisata Provinsi Kalimantan Barat atau yang disebut DISPORAPAR, dibentuk berdasarkan Peraturan Daerah Provinsi Kalimantan Barat Nomor 10 tahun 2008 tentang Susunan Organisasi Perangkat Daerah Provinsi Kalimantan Barat serta Peraturan Gubernur Kalimantan Barat Nomor 42 tahun 2008 tentang Tugas Pokok, Fungsi dan Tata Kerja Dinas Kepemudaan, Olahraga dan Pariwisata Provinsi Kalimantan Barat.</p>\r\n\r\n<p><strong>Tugas dan Fungsi</strong></p>\r\n\r\n<p>Dinas Kepemudaan, Olahraga dan Pariwisata&nbsp; bertugas melaksanakan urusan Pemerintah Provinsi di Bidang Pemuda, Olahraga, Pariwisata melaksanakan tugas dekonsentrasi dan tugas lainnya yang diserahkan oleh Gubernur sesuai dengan Perundang-undangan yang berlaku. Untuk penyelenggaraan tugas sebagaimana dimaksud, Dinas Kepemudaan, Olahraga dan Pariwisata mempunyai fungsi sebagai berikut :</p>\r\n\r\n<ol>\r\n	<li>Perumusan kebijakan teknis di bidang kepemudaan, olahraga serta sarana, prasarana dan kemitraan;</li>\r\n	<li>Penyelenggaraan urusan pemerintah dan pelayanan umum di bidang kepemudaan, keolahragaan, serta sarana, prasarana dan kemitraan sesuai dengan perundang-undangan yang berlaku;</li>\r\n	<li>Pelaksanaan tugas di bidang Kepemudaan, Keolahragaan serta Sarana, Prasarana dan Kemitraan sesuai dengan peraturan perundangundangan yang berlaku;</li>\r\n	<li>Penyelenggaraan monitoring, evaluasi dan pelaporan pelaksanaan tugas di bidang kepemudaan, keolahragaan, serta sarana, prasarana dan kemitraan;</li>\r\n	<li>Pembinaan dan pengawasan penyelenggaraan tugas dan fungsi di bidang kepemudaan, keolahragaan, serta sarana, prasarana dan kemitraan sesuai dengan perundang-undangan yang berlaku;</li>\r\n	<li>Pengelolaan administrasi kepegawaian, keuangan, dan asset di lingkungan dinas;</li>\r\n	<li>Pelaksanaan tugas dekonsentrasi, tugas pembantuan dan tugas lainnya di bidang pemuda dan olahraga yang diserahkan oleh Gubernur.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Struktur Organisasi</strong></p>\r\n\r\n<p>Kepala Dinas berada di bawah dan bertanggung jawab kepada Gubernur melalui Sekretaris Daerah. Kepala Dinas mempunyai tugas memimpin, membina, mengkoordinasi dan memfasilitasi, menyelenggarakan, mengawasi, mengevaluasi dan mengendalikan kegiatan Dispora sesuai dengan peraturan perundang-undangan yang berlaku. Di mana untuk melaksanakan tugas Kepala Dinas mempunyai fungsi sebagai berikut :</p>\r\n\r\n<ol>\r\n	<li>Menetapkan program kerja di bidang pemuda dan olahraga sebagai bahan pelaksanaan tugas.</li>\r\n	<li>Merumuskan kebijakan teknis di bidang pemuda dan olahraga berdasarkan peraturan perundang-undangan yang berlaku.</li>\r\n	<li>Mengkoordinasi dan fasilitasi kegiatan di bidang pemuda dan olahraga berdasarkan peraturan perundang-undangan yang berlaku.</li>\r\n	<li>Mengendalikan kegiatan di bidang pemuda dan olahraga berdasarkan peraturan perundang-undangan yang berlaku.</li>\r\n	<li>Pembinaan dan pengawasan pelaksanaan tugas dan fungsi di bidang pemuda dan olahraga sesuai peraturan perundang-undangan yang berlaku.</li>\r\n	<li>Pemberian perizinan dan pelayanan umum di bidang pemuda dan olahraga berdasarkan peraturan yang berlaku.</li>\r\n	<li>Pemberian saran dan pertimbangan kepada Gubernur berkenaan dengan kebijakan di bidang pemuda dan olahraga.</li>\r\n	<li>Menyelenggarakan monitoring, evaluasi dan laporan terhadap pelaksanaan tugas pokok dan fungsi di bidang pemuda dan olahraga berdasarkan program kerja yang ditetapkan.</li>\r\n	<li>Pelaksanaan tugas dekonsentrasi, tugas pembantuan dan tugas lainnya di bidang pemuda dan olahraga yang diserahkan oleh Gubernur.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 2, '2022-06-29 22:33:13', '2022-06-29 22:33:13', 0),
(7, 5, 'visi-misi', 'VISI & MISI', NULL, NULL, NULL, '<p><img alt=\"\" src=\"https://disporapar.kalbarprov.go.id/public/assets/images/upload/2020/photo_2020-11-02_03-39-57.jpg\" /></p>', NULL, NULL, NULL, NULL, NULL, 2, '2022-06-29 22:34:42', '2022-06-29 22:34:42', 0),
(8, 6, 'sumber-daya-aparatur', 'SUMBER DAYA APARATUR', NULL, NULL, NULL, '<p><strong>Sumber Daya Aparatur</strong></p>\r\n\r\n<p>Untuk mendukung operasionalisasi SKPD melalui Sumber daya Mamusia yang dimiliki Dinas Kepemudaan, Olahraga dan Pariwisata Provinsi Kalimantan Barat, maka kondisi pegawai Disporapar per 31 Desember 2012 didukung 69 orang PNS dan 16 orang sebagai tenaga kontrak.</p>\r\n\r\n<p>Berikut disampaikan perkembangan pegawai Dinas Pemuda dan Olahraga berdasarkan jenis kelamin, golongan, jabatan dan tingkat pendidikan yang ditabulasikan kedalam daftar berikut :</p>\r\n\r\n<p>Kualifikasi Pendidikan</p>\r\n\r\n<p>a). S-3 : Orang</p>\r\n\r\n<p>b). S-2 : 7 Orang</p>\r\n\r\n<p>c). S-1 : 20 Orang</p>\r\n\r\n<p>d). Diploma : 2 Orang</p>\r\n\r\n<p>e). SLTA : 37 Orang</p>\r\n\r\n<p>f). SLTP : 3 Orang</p>\r\n\r\n<p>g). SD : 0 Orang</p>\r\n\r\n<p>Jumlah 69 Orang</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Pangkat /Golongan</strong></p>\r\n\r\n<p>a). Golongan IV</p>\r\n\r\n<p>Pembina Utama Madya (IV/d) : 1 Orang</p>\r\n\r\n<p>Pembina Tk I (IV/b) : 2 Orang</p>\r\n\r\n<p>Pembina (IV/a) : 5 Orang</p>\r\n\r\n<p>b) Golongan III</p>\r\n\r\n<p>Penata Tk I (III/d) : 4 Orang</p>\r\n\r\n<p>Penata (III/c) : 9 Orang</p>\r\n\r\n<p>Penata Muda Tk I (III/b) : 9 Orang</p>\r\n\r\n<p>Penata Muda (III/a) : 7 Orang</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>c) Golongan II</p>\r\n\r\n<p>Pengatur Tk I (II/d) : 1 Orang</p>\r\n\r\n<p>Pengatur (II/c) : 4 Orang</p>\r\n\r\n<p>Pengatur Muda Tk I (II/b) 0 Orang</p>\r\n\r\n<p>Pengatur Muda (II/a) : 26 Orang</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>d) Golongan I</p>\r\n\r\n<p>Juru (I/c) : 1 Orang</p>\r\n\r\n<p>Jumlah 69 Orang</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Pejabat Struktural dan Fungsional</strong></p>\r\n\r\n<p>a). Eselon II : 1 Orang</p>\r\n\r\n<p>b). Eselon III : 4 Orang</p>\r\n\r\n<p>c). Eselon IV : 11 Orang</p>\r\n\r\n<p>d). Non Eselon : 53 Orang</p>\r\n\r\n<p>e). Fungsional : 0 Orang</p>', NULL, NULL, NULL, NULL, NULL, 2, '2022-06-29 22:35:22', '2022-06-29 22:35:22', 0),
(9, 7, 'data-laporan-ppt', 'DATA LAPORAN PPT', NULL, NULL, NULL, '<p><iframe frameborder=\"0\" height=\"500\" scrolling=\"no\" src=\"https://disporapar.onprocess.work/filemanager?default_load=/shares/PPT\" width=\"100%\"></iframe></p>', NULL, NULL, NULL, NULL, NULL, 2, '2022-06-29 22:41:59', '2022-07-01 14:18:34', 0),
(10, 8, 'sambutan-kepala-dinas', 'SAMBUTAN KEPALA DINAS', NULL, NULL, NULL, '<p>SAMBUTAN KEPALA DINAS</p>', NULL, NULL, NULL, NULL, NULL, 2, '2022-06-29 23:22:54', '2022-06-29 23:22:54', 0),
(12, 10, 'faq', 'FAQ', NULL, NULL, NULL, '<p><strong>Apa saja syarat yang diperlukan untuk usaha pariwisata lintas kabupaten/kota ?</strong></p>\r\n\r\n<p>Silakan mendaftar melalui OSS (Online Single Submission) , selanjutnya Dinas Kepemudaan, Olahraga dan Pariwisata Prov Kalbar akan menentukan/membuat pertimbangan teknis penerbitan izin usaha pariwisata.</p>\r\n\r\n<p><strong>Syarat apa yang di butuhkan untuk peminjaman GOR Pangsuma jika ingin melakukan acara hiburan atau event olahraga ?</strong></p>\r\n\r\n<p>Mengajukan permohonan tertulis peminjaman kepada Dinas Kepemudaan, Olahraga dan Pariwisata Prov Kalbar, selanjutnya apabila disetujui/diijinkan, peminjam harus menunjukkan bukti/kwitansi pembayaran pada Kas Daerah dengan nomor rekening yang ditentukan sebesar ketentuan berlaku, sebelum pelaksanaan kegiatan.</p>\r\n\r\n<p><span style=\"color:#ffffff\"><strong><span style=\"background-color:#e74c3c\">Khusus selama Pandemi Covid-19 peminjaman di tiadakan.</span></strong></span></p>\r\n\r\n<p><strong>Bagaimana mendapatkan Sertifikasi CHSE (Cleanliness,Health,Safety and Environment)</strong></p>\r\n\r\n<p>Daftar memalui link pendaftaran yang sudah disiapkan Kemenparekraf RI, selanjutnya auditor akan menjadwalkan dan menghubungi untuk pelaksanaannya.</p>\r\n\r\n<p><strong>Apabila ingin melaksanakan event tingkat Provinsi, Apakah Persyaratan ?</strong></p>\r\n\r\n<p>Kewenangan&nbsp;Dinas Kepemudaan, Olahraga dan Pariwisata Prov Kalbar hanya memfasilitasi (seoerti : membantu promosi, berkoordinasi dengan Kemenparekraf RI), tetapi untuk rekomendasi harus dari Dinas yang menangani Pariwisata di tempat event tersebut dilaksanakan.</p>', NULL, NULL, NULL, NULL, NULL, 2, '2022-06-29 23:43:58', '2022-06-29 23:43:58', 0),
(13, 11, 'hubungi-kami', 'Hubungi Kami', NULL, NULL, NULL, '<p><iframe align=\"middle\" frameborder=\"0\" height=\"500\" scrolling=\"no\" src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3989.8168880441776!2d109.33637281535792!3d-0.0485487355433512!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x2e1d59a38bd2e039%3A0x3aeb1127a4db5f02!2sDisporapar%20Prov.Kalbar!5e0!3m2!1sid!2sid!4v1607427228281!5m2!1sid!2sid\" width=\"100%\"></iframe></p>\r\n\r\n<form action=\"https://disporapar.test/store/hubungi-kami\" enctype=\"multipart/form-data\" id=\"contactUs\" method=\"post\" name=\"Hubungi Kami\">\r\n<p>Nama*&nbsp; &nbsp; :&nbsp;&nbsp;<input name=\"Nama\" required=\"required\" type=\"text\" /></p>\r\n\r\n<p>Telp/Hp* :&nbsp;&nbsp;<input name=\"phone\" required=\"required\" type=\"tel\" /></p>\r\n\r\n<p>Pesan*&nbsp; &nbsp;:</p>\r\n\r\n<p><textarea name=\"Pesan\" required=\"required\" rows=\"5\"></textarea></p>\r\n\r\n<p><input name=\"Kirim\" type=\"submit\" value=\"Kirim\" /></p>\r\n</form>\r\n\r\n<p>&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 2, '2022-06-29 23:47:04', '2022-06-30 00:20:19', 0),
