(9, 11, 'BinshopsBlog\\Models\\BinshopsPostTranslation', 'FAQ', '<p><span style=\"font-size:14px\"><strong>Apa saja syarat yang diperlukan untuk usaha pariwisata lintas kabupaten/kota ?</strong></span></p>\r\n\r\n<p>Silakan mendaftar melalui OSS (Online Single Submission) , selanjutnya Dinas Kepemudaan, Olahraga dan Pariwisata Prov Kalbar akan menentukan/membuat pertimbangan teknis penerbitan izin usaha pariwisata.</p>\r\n\r\n<div style=\"page-break-after:always\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p><span style=\"font-size:14px\"><strong>Syarat apa yang di butuhkan untuk peminjaman GOR Pangsuma jika ingin melakukan acara hiburan atau event olahraga ?</strong></span></p>\r\n\r\n<p>Mengajukan permohonan tertulis peminjaman kepada Dinas Kepemudaan, Olahraga dan Pariwisata Prov Kalbar, selanjutnya apabila disetujui/diijinkan, peminjam harus menunjukkan bukti/kwitansi pembayaran pada Kas Daerah dengan nomor rekening yang ditentukan sebesar ketentuan berlaku, sebelum pelaksanaan kegiatan.</p>\r\n\r\n<p><span style=\"color:#ffffff\"><strong><span style=\"font-size:14px\"><span style=\"background-color:#e74c3c\">Khusus selama Pandemi Covid-19 peminjaman di tiadakan.</span></span></strong></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><strong>Bagaimana mendapatkan Sertifikasi CHSE (Cleanliness,Health,Safety and Environment)</strong></span></p>\r\n\r\n<p>Daftar memalui link pendaftaran yang sudah disiapkan Kemenparekraf RI, selanjutnya auditor akan menjadwalkan dan menghubungi untuk pelaksanaannya.</p>\r\n\r\n<p><span style=\"font-size:14px\"><strong>Apabila ingin melaksanakan event tingkat Provinsi, Apakah Persyaratan ?</strong></span></p>\r\n\r\n<p>Kewenangan&nbsp;Dinas Kepemudaan, Olahraga dan Pariwisata Prov Kalbar hanya memfasilitasi (seoerti : membantu promosi, berkoordinasi dengan Kemenparekraf RI), tetapi untuk rekomendasi harus dari Dinas yang menangani Pariwisata di tempat event tersebut dilaksanakan.</p>', '2022-06-29 23:43:07', '2022-06-29 23:43:07'),
(10, 12, 'BinshopsBlog\\Models\\BinshopsPostTranslation', 'FAQ', '<p><strong>Apa saja syarat yang diperlukan untuk usaha pariwisata lintas kabupaten/kota ?</strong></p>\r\n\r\n<p>Silakan mendaftar melalui OSS (Online Single Submission) , selanjutnya Dinas Kepemudaan, Olahraga dan Pariwisata Prov Kalbar akan menentukan/membuat pertimbangan teknis penerbitan izin usaha pariwisata.</p>\r\n\r\n<p><strong>Syarat apa yang di butuhkan untuk peminjaman GOR Pangsuma jika ingin melakukan acara hiburan atau event olahraga ?</strong></p>\r\n\r\n<p>Mengajukan permohonan tertulis peminjaman kepada Dinas Kepemudaan, Olahraga dan Pariwisata Prov Kalbar, selanjutnya apabila disetujui/diijinkan, peminjam harus menunjukkan bukti/kwitansi pembayaran pada Kas Daerah dengan nomor rekening yang ditentukan sebesar ketentuan berlaku, sebelum pelaksanaan kegiatan.</p>\r\n\r\n<p><span style=\"color:#ffffff\"><strong><span style=\"background-color:#e74c3c\">Khusus selama Pandemi Covid-19 peminjaman di tiadakan.</span></strong></span></p>\r\n\r\n<p><strong>Bagaimana mendapatkan Sertifikasi CHSE (Cleanliness,Health,Safety and Environment)</strong></p>\r\n\r\n<p>Daftar memalui link pendaftaran yang sudah disiapkan Kemenparekraf RI, selanjutnya auditor akan menjadwalkan dan menghubungi untuk pelaksanaannya.</p>\r\n\r\n<p><strong>Apabila ingin melaksanakan event tingkat Provinsi, Apakah Persyaratan ?</strong></p>\r\n\r\n<p>Kewenangan&nbsp;Dinas Kepemudaan, Olahraga dan Pariwisata Prov Kalbar hanya memfasilitasi (seoerti : membantu promosi, berkoordinasi dengan Kemenparekraf RI), tetapi untuk rekomendasi harus dari Dinas yang menangani Pariwisata di tempat event tersebut dilaksanakan.</p>', '2022-06-29 23:43:58', '2022-06-29 23:43:58'),
(11, 13, 'BinshopsBlog\\Models\\BinshopsPostTranslation', 'Hubungi Kami', '<p><iframe align=\"middle\" frameborder=\"0\" height=\"500\" scrolling=\"no\" src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3989.8168880441776!2d109.33637281535792!3d-0.0485487355433512!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x2e1d59a38bd2e039%3A0x3aeb1127a4db5f02!2sDisporapar%20Prov.Kalbar!5e0!3m2!1sid!2sid!4v1607427228281!5m2!1sid!2sid\" width=\"100%\"></iframe></p>\r\n\r\n<form action=\"https://disporapar.test/store/hubungi-kami\" enctype=\"multipart/form-data\" id=\"contactUs\" method=\"post\" name=\"Hubungi Kami\">\r\n<p>Nama*&nbsp; &nbsp; :&nbsp;&nbsp;<input name=\"Nama\" required=\"required\" type=\"text\" /></p>\r\n\r\n<p>Telp/Hp* :&nbsp;&nbsp;<input name=\"phone\" required=\"required\" type=\"tel\" /></p>\r\n\r\n<p>Pesan*&nbsp; &nbsp;:</p>\r\n\r\n<p><textarea name=\"Pesan\" required=\"required\" rows=\"5\"></textarea></p>\r\n\r\n<p><input name=\"Kirim\" type=\"submit\" value=\"Kirim\" /></p>\r\n</form>\r\n\r\n<p>&nbsp;</p>', '2022-06-29 23:47:04', '2022-06-30 00:20:19'),
